import Rete from "rete";
import * as Socket from "../sockets";

import { TimeControl } from '@/node-editor/controls/TimeControl/TimeControl'

export class DurationComponent extends Rete.Component {
    constructor(){
        super("Duration (s)");
    }

    builder(node) {
        var out1 = new Rete.Output('num', "Out", Socket.number);
        return node

          .addControl(new TimeControl(this.editor, 'num'))
          .addOutput(out1);
    }

    worker(node, inputs, outputs) {
        outputs['num'] = node.data.num;
    }

    toJsonLogic(node) {
        return node.data.num;
    }
}
